var eA=Math.atan2(y-G/2,x-G/2)+(srand(x,y,44)-.5)*1.2;var eF=.8+srand(x,y,55)*2.5,eS=.004+srand(x,y,66)*.015;
var jA=.2+srand(x,y,77)*.7,jS=.035+srand(x,y,88)*.08;

cr:Math.min(255,Math.round(r*1.1)),cg:Math.min(255,Math.round(g*1.1)),cb:Math.min(255,Math.round(b*1.1)),x:x,y:y,isEdge:isEdge,u:srand(x,y,123)})}
function render(){ctx.fillStyle="#000";ctx.fillRect(0,0,SIZE,SIZE);var hb=Math.pow(Math.sin(t*.015),2)*.02;var cx2=SIZE/2,cy2=SIZE/2;var wc=(t%900)/900;
